import React from 'react';


class ClubList extends React.Component {

    render() {
        console.log(this.props.clubs[0].name);
        const item = this.props.clubs.map((club) => {
            return (
                <li>{club.name}</li>
            )
        });
    return (
      <div>
       <ul>
        {item}   
       </ul>
      </div>
    );
  }
}

export default ClubList;
